import React from 'react';

function OilGas() {
  return (
    <div className="p-10 text-center">
      <h2 className="text-3xl font-bold mb-4 text-purple-700">OilGas</h2>
      <p className="text-gray-700">Discover how modern tech is improving supply chain efficiency, tracking, and automation.</p>
    </div>
  );
}

export default OilGas;
